import React, {Component} from "react";
import AceEditorComponent from "./AceEditorComponent";
import brace from "brace";
import AceEditor from "react-ace";
import "brace/mode/java";
import "brace/theme/github";

class AceEditorContainer extends Component {
    constructor(props){
        super();
        this.state = {
            aceValue: ""
        }
    }

    onChange = newValue => {
        this.setState({aceValue: newValue});
    }

    render(){
        const props = (
            <AceEditor
                mode="java"
                theme="github"
                onChange={this.onChange}
                name="ace_text_editor"
                editorProps={{$blockScrolling: true}}
                readOnly="true"
            /> ,
            document.getElementById( 'ace_editor' )
        )

        return <AceEditorComponent {...props} />
    }
}

export default AceEditorContainer;
